import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Main from '../../components/Main/Main';
import Auto from '../../pages/Auto/Auto';
import Laboratory from '../../pages/Laboratory/Laboratory';
import PrepodRedLab from '../../pages/PrepodRedLab/PrepodRedLab';
import Registration from '../../pages/Registration/Registration';
import { useAuth } from '../../components/AuthContext';

const MainRouter = () => {
  return (
    <Routes>
      <Route path="/" element={<Main />} />
      <Route path="login" element={<Auto />} />
      <PrivateRoute path="Laboratory" role="teacher" element={<Laboratory />} />
      <PrivateRoute
        path="editingLaboratoryPrep"
        role="teacher"
        element={<PrepodRedLab />}
      />
      <Route path="Registration" element={<Registration />} />
      <Route from="/" to="/login" />
    </Routes>
  );
};

const PrivateRoute = ({ element, role }) => {
  const { userRole } = useAuth();

  return userRole === role ? element : null;
};

export default MainRouter;
